import React, {useCallback, useEffect} from 'react';
import {useRegisterUserMutation, useLoginUserMutation, useFindUserQuery, userApi} from "../utils/apis";
import {useLogin, useRegister} from '../utils/login'


const Login = () => {
	// const handleRegister = useCallback()
	// 登录
	// useLogin();
	const data = {
		attributes: {
			username: 'alice',
			pwd: '123456'
		}
	};
	const [register, result] = useRegisterUserMutation();
	console.log(register, result);
	// 注册处理器
	const handleRegister = async () => {
		try {
			// 	调用函数时传入数据, 通过 unwrap() 获取原始响应
			const resp = await register(data).unwrap();
			console.log('注册成功')
		}catch (e){
			console.error('注册失败---',e);
		}
	}

	return (
		<div>
			<form action="">
				<input type="text" placeholder="用户名"/>
				<input type="text" placeholder="请输入密码"/>
				<button type="submit">登录</button>
				<button type="submit">注册</button>
			</form>
		</div>
	);
};

export default Login;
